import React,{useState,useEffect} from "react"
export default function OneEditUser(props)
{
    //states:
    const [ user,setUser] = useState()
    const [ userJson,setUserJSON] = useState({})
    const [ permissions,setPermissions] = useState({})
    const [ firstName,setFirstName] = useState('')
    const [ lastName,setLastName] = useState('')

    useEffect(()=> {
        const editUser = props.user;
        setUser(editUser.user);
        setUserJSON(editUser.userJson);
        setPermissions(editUser.permissions.permissions);


    },[])

    return(
        <div className="oneEditUserDiv">
            First Name : <input type ='text'value={userJson.firstName}/><br/>
            Last Name : <input type ='text'value={userJson.lastName}/><br/>
            Username : <input type ='text'value={userJson.lastName}/><br/>
            Session time out (Mi) : <input type ='text'value={userJson.lastName}/><br/>


        </div>
    )
}
